// Signup.js
import React from "react";

function Signup() {
  return (
    <div style={{ textAlign: "center", padding: "50px" }}>
      <h1>회원가입</h1>
      <p>회원가입 페이지입니다.</p>
    </div>
  );
}

export default Signup;
